import React from 'react';

export default function CustomButton(props){
    return (
        <button style={{
            fontSize: "15px",
            backgroundColor: props && props.bgColor ? props.bgColor : "#ffabab",
            width: "30px",
            height: "30px",
            borderRadius: "50%",
            borderColor: "#ffff",
            position: "absolute",
            top: "0px",
            right: "-8px",
            color: "#525252"
        }}
        onClick={props && props.onClick ? props.handleClick : "" }></button>
    )
}
